import com.example.adaptertest.R
import com.example.adaptertest.databinding.FragmentBinding
import com.example.adaptertest.model.CarModel
import com.example.adaptertest.ui.adapters.CarAdapter


class Fragment : Fragment() {

    private lateinit var binding: FragmentBinding
    private val carAdapter = CarAdapter(this::click)
    private val list = listOf(
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
        CarModel("data:image/jpeg;base64,","mers",2000),
    )
    private fun click(car: CarModel) {
        findNavController().navigate(FragmentDirections.actionFragmentToCarDetailFragment(car))
    }
    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?,
    ): View {
       binding= FragmentBinding.inflate(layoutInflater,container,false)
        return binding.root
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        initialize()
    }
    private fun initialize() {
        binding.recyclerView.apply {
            layoutManager = LinearLayoutManager(requireContext())
            adapter = carAdapter
            carAdapter.submitList(list)
        }
    }

}